import './App.css';
import Data from './data.js';
import Cards from './Cards.jsc'



console.log(Data);

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <ol>
          {Data.map((item) => <li>{item.name}</ li>)}
        </ol>
      </header>
    </div>
  );
}

export default App;
